import{Button}from"/scripts/src/buttons.min.js";import{setOnLoadExternalCard}from"/scripts/src/cards.min.js";import{addHoverEventWithScale}from"/scripts/src/hoverEvents.min.js";import{convertCardToLatex}from"/scripts/src/latex.min.js";import{showPage}from"/scripts/src/loadPage.min.js";import{asyncFetch,pageUrl}from"/scripts/src/main.min.js";export default async function load(){setOnLoadExternalCard((card,id)=>{var t=card.querySelectorAll(".text-button");addHoverEventWithScale({element:t[0],scale:1.05,addBounceOnTouch:()=>!0}),new Button({element:t[0],name:"Download PDF Version",onClick:async()=>{var t=await asyncFetch(pageUrl+`/cards/${id}/data.html`);convertCardToLatex(t,"Math 253")}})}),showPage()}